    private func getRandMapPoint()->MapPoint{
        return MapPoint(coordinate: CLLocation(
            latitude: self.getRand(35.6672459),
            longitude: self.getRand(139.7353941)).coordinate,
            title: "title1",
            subtitle: "subtitle")
    }
    private func getRand(start:CLLocationDegrees) ->CLLocationDegrees{
        return start+CLLocationDegrees(UInt(arc4random_uniform(UInt32(UInt(1000)))))/100000;
    }
